import React from 'react';
import BackBar from '../components/BackBar';
import '../assets/css/CustomResult.css';
class App extends React.Component {

    render() {
      const { history }=this.props;
        return(
          <div className="App">
            <BackBar history={history} title="自定义"/>
            <div>自定义价格</div>
          </div>
        );
    }
}

export default App;
